@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'money-manager';
}
<app-navbar></app-navbar>

<div class="container mt-4">
  <router-outlet></router-outlet>
</div>

<app-footer></app-footer>
